import Head from 'next/head';

function ContumazHead() {
    return (
        <Head>
            
            <link 
            href="https://fonts.googleapis.com/css2?family=Heebo:wght@300;400;700&family=Roboto:wght@300;400;700&display=swap" 
            rel="stylesheet">
            </link>            
        </Head>
    );
}

export default ContumazHead;
